おまとめ梱包対応商品

<style>select[name="choice"]{
height:30px;
}

.choice{
display:block;
margin:20px 0px 10px 0px;
border-width:0px 0px 0px 3px;
border-style:solid;
border-color:#900;
background-image:url("http://image.rakuten.co.jp/interiortool/cabinet/img/tyu_1.gif");
background-repeat:no-repeat;
background-position:right center;
width:350px;
height:22px;
padding:8px 0px 0px 10px;
}</style>特長<br>
　カットテープを壁紙の両端へつける場合には、ブルー・オレンジの使い分けによって施工方面の目安になり便利です。<br>
<br>
サイズ<br>
　巾45mm×長1000m

